import FriendListElement from "./FriendListElement/FriendListElement";
import StoreContext from "../../../StoreContext";

function Friend() {

    return (
        <StoreContext.Consumer>
            {(store) => {
                // let state = store.getState().friendsPage;
                let friendElement = store.friendsData.map(f => <FriendListElement username={f.username}/>)
                return (
                    <div>
                        {friendElement}
                    </div>)
            }}
        </StoreContext.Consumer>
    );
}

export default Friend;
